import React from 'react';
import classes from './Home.module.css'
import BlockHead from "./BlockHead/BlockHead";
import Block2 from "./Block2/Block2";
import Block3 from './Block3/Block3';
import Block4 from "./Block4/Block4";
import Block5 from "./Block5/Block5";
import Block6 from "./Block6Portfolio/Block6";
import Block11 from "./Block11/Block11";



const  Home = (props) =>{
   console.log(props);
    let element = props.arrHead.map(e => <BlockHead text1={e.text1} text2={e.text2} textBold={e.textBold} img={e.img}/>);
    let element2 = props.homeBlock2.map(d=> <Block2 h1={d.h1} h2={d.h2} link={d.link} span={d.text}/>);
    let element3 = props.homeBlock3.map(d=><Block3 title={d.title} text={d.text}/>);
    let element4 = props.homeBlock4;
    let element5 = props.homeBlock5;
    let element11= props.homeBlock11;
    let element6 = props.homeBlock6.map(e => <Block6 img1={e.img1} img2={e.img2} img3={e.img3} img4={e.img4} img5={e.img5} img6={e.img6}  />);

      return (

        <div className={classes.contentBlock}>
            {element}
            <div className={classes.blockItem}>
                {element2}
            </div>
            <div className={classes.blockItem2}>
                {element3}
            </div>
            <div className={classes.blockItem4}>
               <Block4 re={element4} />
            </div>
            <div className={classes.blockItem8}>
                <Block5 re={element5}/>
            </div>
            <div className={classes.blockItem6}>
                {element6}
            </div>
            <div className={classes.blockItem11}>
                <Block11 re={element11}/>
            </div>


        </div>

    );
};


export default Home;
